import React from 'react';
import ReactDOM from 'react-dom';
import * as Main from './App.jsx'
import * as TTT from './test'
import contact from './contacts'
import * as cal from './Heading'

ReactDOM.render(
  <div>

    <div id = "nect">{contact.map(contact =>{ return (
      <cal.default 
      id = {contact.id}
      name = {contact.name}
      tel = {contact.tel}
      email = {contact.email} />
    )})}</div>
    <div id = "Person"></div>
  </div>,
  document.getElementById('roots')
);

